style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("tagged.com") {
    .id-widget-getGold {
        display: none;
    }
    #home-page > div:nth-child(1) {
        width: 1000px;
    }
    #home-page > div:nth-child(1) > div:nth-child(1) {
        width: 500px;
    }
    .id-container-pet-info {
        width: 400px;
    }
    #home-page > div:nth-child(2) > div:nth-child(1) {
        display: none;
    }
    #home-page > div:nth-child(2) > div:nth-child(2) {
        display: none;
    }
    #home-page > div:nth-child(1) > div:nth-child(1) {
        width: 800px;
    }
}
